Для группирования поперечников в вашем DXF файле и последующего анализа, вам потребуется более сложная логика, которая будет искать тексты с определенным содержимым и определять границы между ними. Это можно сделать с использованием библиотеки `ezdxf` для работы с DXF файлами и `numpy` для численных вычислений.

Вот пример кода, который выполняет поставленную задачу:

```python
import ezdxf
import numpy as np
from collections import defaultdict

def find_pickets(dxf_file):
    doc = ezdxf.readfile(dxf_file)
    pickets = defaultdict(list)
    lines = []

    for entity in doc.modelspace().query('*'):
        if entity.dxftype() == 'TEXT':
            text = entity.dxf.text.strip()
            if text.startswith('7+') or text.startswith('ПК7+') or text.startswith('4+') or text.startswith('ПК8+'):
                pickets[text].append(entity.dxf.insert)
        elif entity.dxftype() == 'LINE':
            lines.append((entity.dxf.start, entity.dxf.end))

    return pickets, lines

def find_picket_boundaries(pickets, lines):
    boundaries = defaultdict(list)
    for picket, entities in pickets.items():
        entities.sort(key=lambda e: e[1])  # Сортировка по X координате конца текста
        boundary_y = None
        boundary_x = None
        for i, (entity) in enumerate(entities):
            start_x, start_y = entity[0]
            end_x, end_y = entity[1]

            if boundary_y is None:
                boundary_y = end_y
                boundary_x = (start_x + end_x) / 2

            if i < len(entities) - 1:
                next_entity = entities[i + 1]
                next_start_x, next_start_y = next_entity[0]
                next_end_x, next_end_y = next_entity[1]

                if abs(next_start_x - start_x) > abs(next_end_x - start_x):
                    boundary_x = (start_x + next_start_x) / 2
                else:
                    boundary_y = (start_y + next_start_y) / 2

        for line_start, line_end in lines:
            start_x, start_y = line_start
            end_x, end_y = line_end
            if abs(end_x - start_x) < abs(end_y - start_y):
                if start_y <= boundary_y <= end_y:
                    boundaries[picket].append((start_x, end_x))
                elif start_y > end_y:
                    boundaries[picket].append((start_x, min(end_x, boundary_x)))
                else:
                    boundaries[picket].append((start_x, max(end_x, boundary_x)))
            else:
                if start_x <= boundary_x <= end_x:
                    boundaries[picket].append((start_y, end_y))
                elif start_x > end_x:
                    boundaries[picket].append((start_y, min(end_y, boundary_y)))
                else:
                    boundaries[picket].append((start_y, max(end_y, boundary_y)))

    return boundaries

def main():
    dxf_file_path = select_file()
    if dxf_file_path:
        pickets, lines = find_pickets(dxf_file_path)
        boundaries = find_picket_boundaries(pickets, lines)
        for picket, boundary in boundaries.items():
            print(f"Пикет: {picket}")
            for boundary_line in boundary:
                print(f"  Граница: ({boundary_line[0]}, {boundary_line[1]})")
    else:
        print("Файл не выбран.")

if __name__ == "__main__":
    main()
```

Этот код делает следующее:

1. **Ищет тексты с определенным содержимым** в DXF файле. Эти тексты обозначают пикеты.
2. **Ищет горизонтальные линии** в DXF файле, которые могут служить границами между поперечниками.
3. **Определяет границы** между пикетами по горизонтали и вертикали, используя логику, которую вы описали.

Запуск этого кода сконвертирует DXF файл в текстовый файл, где each пикет и его граница будут отображаться в отдельной строке.

