To solve the "Decode String" problem, we need to decode the given encoded string where the encoded string inside square brackets is repeated exactly `k` times. Here's a C++ implementation that addresses the problem:

```cpp
class Solution {
public:
    string decodeString(string s) {
        int n = s.length();
        stack<char> st;
        int num = 0;
        string ans = "";

        for (int i = 0; i < n; i++) {
            if (s[i] == ']') {
                // Pop the characters until we find '['
                string temp = "";
                while (!st.empty() && st.top() != '[') {
                    temp = st.top() + temp;
                    st.pop();
                }
                st.pop(); // Pop the '['

                // Pop the number of times to repeat
                string numStr = "";
                while (!st.empty() && isdigit(st.top())) {
                    numStr = st.top() + numStr;
                    st.pop();
                }
                num = stoi(numStr);

                // Repeat the string 'num' times and push it back to the stack
                for (int j = 0; j < num; j++) {
                    temp += st.empty() ? "" : st.top();
                }
                st.push(temp);
            } else {
                st.push(s[i]);
            }
        }

        // Pop all remaining characters from the stack to form the final string
        while (!st.empty()) {
            ans = st.top() + ans;
            st.pop();
        }

        return ans;
    }
};
```

### Explanation:

1. **Stack Initialization**: We use a stack to store characters and numbers.
2. **Iteration through the String**:
   - When we encounter a `]`, we pop characters until we find a `[` and store them in a temporary string.
   - We then pop the `[` and the number of times the string should be repeated.
   - We repeat the string `num` times and push it back to the stack.
3. **Handling Normal Characters**: If we encounter any other character, we simply push it onto the stack.
4. **Final Construction**: After processing the entire string, we pop all remaining characters from the stack to form the final decoded string.

This approach ensures that we correctly handle nested repetitions and construct the decoded string step by step.

